import './ItemStyle.scss';

function Item(props: {itemstack: any, amount: number;}){
    if (props.itemstack.id === null){
        return (
            <div className="item"></div>
        );
    }else{
        return (
            <div className="item">
                <img style={{width: 50, height: 50}} src={props.itemstack.texture} />
                <span className='item-amount'>{props.amount}</span>
            </div>
        );
    }
}
export default Item;
